import React, { useEffect, useState } from "react";
import { Map, CustomOverlayMap } from "react-kakao-maps-sdk";
import DataGraph from "./DataGraph";
import { Box, Typography, useTheme } from "@mui/material";

function Dashboard() {
  const containerStyle = {
    width: "100%",
    height: "600px",
  };

  const [location, setLocation] = useState(null);
  const [isStolen, setIsStolen] = useState(false); // ÎèÑÎÇú Ïó¨Î∂Ä ÏÉÅÌÉú Ï∂îÍ∞Ä

  const theme = useTheme(); // ÌÖåÎßà Í∞ÄÏ†∏Ïò§Í∏∞

  useEffect(() => {
    const fetchLocationData = async () => {
      try {
        const response = await fetch("http://localhost:5000/get-location", {
          method: "GET",
          headers: {
            "Content-Type": "application/json",
            Accept: "application/json",
          },
        });

        if (response.ok) {
          const data = await response.json();
          setLocation({
            lat: parseFloat(data.latitude),
            lng: parseFloat(data.longitude),
          });

          // ÎèÑÎÇú Ïó¨Î∂Ä Ï†ïÎ≥¥ ÏòàÏãúÎ°ú ÏÑ§Ï†ï
          setIsStolen(data.isStolen); // ÏÑúÎ≤ÑÏóêÏÑú ÎèÑÎÇú Ïó¨Î∂Ä Í∞íÏùÑ Î∞õÏïÑÏÑú ÏÑ§Ï†ï
        } else {
          console.error("Failed to fetch location data");
        }
      } catch (error) {
        console.error("Error fetching location:", error);
      }
    };

    const intervalId = setInterval(fetchLocationData, 5000);

    return () => clearInterval(intervalId);
  }, []);

  if (!location) {
    return (
      <div className="dashboard-container" style={{ textAlign: "center" }}>
        <Typography variant="h4" sx={{ fontFamily: "'Sour Gummy', cursive" }}>
          Loading location... üòÖ
        </Typography>
      </div>
    );
  }

  return (
    <Box
      sx={{
        display: "flex",
        flexDirection: "row",
        gap: 4,
        fontFamily: "'Sour Gummy', cursive", // Î™®Îì† ÌÖçÏä§Ìä∏Ïóê Ìè∞Ìä∏ Ï†ÅÏö©
        padding: 2,
        flexWrap: "wrap",
      }}
    >
      {/* ÏßÄÎèÑ ÏÑπÏÖò */}
      <Box
        sx={{
          flex: 1,
          padding: 2,
          borderRadius: 2,
          boxShadow: 3,
          backgroundColor: "#fff",
        }}
      >
        <Typography variant="h6" align="center" gutterBottom sx={{ fontFamily: "'Sour Gummy', cursive" }}>
          SafetyBox Location
        </Typography>
        <Map
          center={{ lat: location.lat, lng: location.lng }}
          level={3}
          style={containerStyle}
          appKey="27def025665d22e2a866f398cfb7a3aa"
        >
          {/* Custom Overlay */}
          <CustomOverlayMap position={{ lat: location.lat, lng: location.lng }} zIndex={1}>
            <div style={{ position: "relative", display: "flex", flexDirection: "column", alignItems: "center" }}>
              <img
                src="/marker.png"
                alt="marker"
                style={{ width: "36px", height: "36px" }}
              />
              <div
                className="custom-overlay"
                style={{ fontSize: "14px", fontWeight: "bold", color: "#333", fontFamily: "'Sour Gummy', cursive" }}
              >
                SafetyBox
              </div>
            </div>
          </CustomOverlayMap>
        </Map>
      </Box>

      {/* ÎèÑÎÇú Ïó¨Î∂Ä Î∞è Sensor Data ÏÑπÏÖò */}
      <Box
        sx={{
          flex: 1,
          padding: 2,
          borderRadius: 2,
          boxShadow: 3,
          backgroundColor: "#fff",
        }}
      >
        <Typography variant="h6" align="center" gutterBottom sx={{ fontFamily: "'Sour Gummy', cursive" }}>
          SafetyBox ÏÉÅÌÉú
        </Typography>
        <Box
          sx={{
            border: `1px solid ${theme.palette.divider}`, // ÌÖåÎßàÏóê ÎßûÍ≤å Íµ¨Î∂ÑÏÑ† ÏÉâÏÉÅ Ï†ÅÏö©
            padding: 2,
            marginBottom: 2,
            borderRadius: 1,
            backgroundColor: theme.palette.background.paper, // Î∞∞Í≤ΩÏÉâ ÌÖåÎßàÏóê ÎßûÍ≤å ÏÑ§Ï†ï
            boxShadow: 1,
          }}
        >
          <Typography variant="subtitle1" color="text.primary" sx={{ fontFamily: "'Sour Gummy', cursive" }}>
            ÎèÑÎÇú Ïó¨Î∂Ä
          </Typography>
          <Typography
            variant="h6"
            sx={{
              color: isStolen ? theme.palette.error.main : theme.palette.success.main, // ÎèÑÎÇú Ïó¨Î∂ÄÏóê Îî∞Î•∏ ÏÉâÏÉÅ Ï†ÅÏö©
              fontFamily: "'Sour Gummy', cursive",
            }}
          >
            {isStolen ? "ÎèÑÎÇúÎê®" : "ÏïàÏ†Ñ"}
          </Typography>
        </Box>
        <DataGraph />
      </Box>
    </Box>
  );
}

export default Dashboard;
